  var preferFood = [];
  for (var i = 0; i < prefer[0].length; i++) {
    preferFood.push(prefer[0][i].f_category_name);
  }
  return {
    email: user[0].email,
    name: user[0].user_name,
    preferCategory: preferFood
  };
};
